/*Table structure for table `test` */

DROP TABLE IF EXISTS `test`;

CREATE TABLE `test` (
  `ID` int(11) NOT NULL default '0',
  `stID` bigint(20) default NULL,
  `csID` bigint(20) default NULL,
  PRIMARY KEY  (`ID`),
  KEY `stID` (`stID`),
  KEY `csID` (`csID`),
  CONSTRAINT `test_ibfk_1` FOREIGN KEY (`stID`) REFERENCES `st_user` (`ID`),
  CONSTRAINT `test_ibfk_2` FOREIGN KEY (`csID`) REFERENCES `st_course` (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

